// Load the bcrypt module
var bcrypt = require('bcrypt');
// Generate a salt
var salt = bcrypt.genSaltSync(10);


var mysql = require('mysql');

var db_config = {
    host: 'localhost',
    user: 'root',
    password: '',
    database: 'serenity'
};
var connection;
function handleDisconnect() {
    connection = mysql.createConnection(db_config); // Recreate the connection, since
    // the old one cannot be reused.

    connection.connect(function (err) {              // The server is either down
        if (err) {                                     // or restarting (takes a while sometimes).
            console.log('error when connecting to db:', err);
            setTimeout(handleDisconnect, 2000); // We introduce a delay before attempting to reconnect,
        }                                     // to avoid a hot loop, and to allow our node script to
    });                                     // process asynchronous requests in the meantime.
    // If you're also serving http, display a 503 error.
    connection.on('error', function (err) {
            console.log('db error', err);
            if (err.code === 'PROTOCOL_CONNECTION_LOST') { // Connection to the MySQL server is usually
                handleDisconnect();                         // lost due to either server restart, or a
            } else {                                      // connnection idle timeout (the wait_timeout
                throw err;                                 // server variable configures this)
            }
        }
    );
}
handleDisconnect();

express = require('express.io')
app = express().http().io()

//var md5 = require('MD5');

// Setup sessions
app.use(express.cookieParser())
app.use(express.session({secret: 'thisIsAnAwesomeGame'}))

app.use(express.static('../client'));

// Session is automatically setup on initial request.
app.get('/', function (req, res) {
    req.session.lastActive = new Date().toString()
    res.sendfile('../client/index.html')
})


app.io.route('login', function (req) {
    var sid = req.sessionID;
    var username = req.data.name;
    var password = req.data.password;

    connection.query('SELECT userId, username, sessionId, password FROM `serenity`.`users` WHERE username = ?', [username], function (err, rows, fields) {
        if (err) {
            throw err;
        }
        console.log(rows.length);

        if (rows.length > 0) {
            bcrypt.compare(rows[0]['password'], password, function(err, res) {
                if(res) {
                    req.session.username = rows[0]['username'];
                    req.session.userId = rows[0]['userId'];
                    if (rows[0]['sessionId'] != sid) {
                        connection.query("UPDATE `serenity`.`users` SET sessionId = ? WHERE username = ?", [sid, username]);
                    }
                    console.log('login of userId: ' + rows[0]['userId'] + ' username: ' + rows[0]['username']);
                    req.io.emit('loggedIn', {userId: rows[0]['userId']});
                }
                else {
                    req.io.emit('loginError', {msg: "wrong password!"});
                    console.log('loginError of userId: ' + rows[0]['userId'] + ' username: ' + rows[0]['username']);
                }
            });
        } else {
            req.io.emit('loginError', {msg: "username does not exist!"});
        }
    });
})

app.io.route('register', function (req) {

    var sid = req.sessionID;
    var username = req.data.name;
    var password = req.data.password;
    var email = req.data.email;

    connection.query('SELECT userId,username,email FROM `serenity`.`users` WHERE username = ? OR email = ?', [username, email], function (err, rows, fields) {
        if (err) throw err;
        console.log('rows.length=' + rows.length);

        if (rows.length > 0) {
            var errormessage = "";
            if (rows[0]['username'] == username) {
                errormessage = "username already exists!";
            }
            if (rows[0]['email'] == email) {
                errormessage = "email already exists!";
            }
            req.io.emit('registerFeedback', {
                success: false,
                errormessage: errormessage
            })
        } else {
            // Hash the password with the salt
            var pwhash = bcrypt.hashSync(password, salt);
            //console.log("pwhash length = " + pwhash.length)
            connection.query('INSERT INTO `serenity`.`users` SET ?', {username: username, email: email, password: pwhash, sessionId: sid}, function (err, result) {
                if (err) throw err;

                console.log("insertId=" + result.insertId);
                req.session.username = username;
                req.session.userId = result.insertId;
                req.io.emit('registerFeedback', {
                    success: true
                })
                req.io.emit('loggedIn', {userId: result.insertId});
            });
        }
    });

})

app.io.route('ready', function (req) {
    var sid = req.sessionID;

    // check if logged in:

    var sid = req.sessionID;
    connection.query('SELECT sessionId,userId,username FROM `serenity`.`users` WHERE sessionId = ?', [sid], function (err, rows, fields) {
        if (err) throw err;
        console.log(rows.length);
        if (rows.length > 0) {
            req.session.username = rows[0]['username'];
            req.session.userId = rows[0]['userId'];
            console.log("userId " + rows[0]['userId'] + " is back!")
        }
        else {
            req.io.emit('loginPrompt');
        }
    });

    // send map data anyway:
    req.io.emit('mapData', {message: mapDataJson});

})

